    <header><nav><a href="/index.html">Minh Ton</a> <a href="/projects.html">Projects</a> <a href="/services/game/index.html">Game Development Services</a></nav></header><main><section><h1>Bleed Game 2D Platformer</h1><p>3 months | Solo Project | Completed<p>Engineered a complete 2D RPG game engine from scratch in Java, featuring player stats, inventory, quests, skill effects, enemy AI, and dynamic level design — all built without external game engines.</p><a href="https://github.com/Game2D-TM/BleedGame">View Github</a> <a href="/services/game/index.html">Contact to build a similar game</a></section><section><h2>Project Overview</h2><p>Built an engine-less 2D game entirely from scratch using Java AWT, focusing on modular and extensible architecture.<p>Implemented custom systems such as game loop, AI, collision detection, inventory, quests, and data-driven UI.<p>Prioritized logic and code structure over visual polish for long-term scalability and clarity.<p>Designed a fully data-driven level system where all gameplay elements — including tilemaps, enemies, items, NPCs, objects, quests, traps, dialogues, and level transitions — are dynamically loaded from external configuration files.<p>This allows levels to be created, modified, or extended without changing core game logic, enabling scalable and modular level design.<p>Built solo, with only minor help on code review and asset integration.</section><section><h2>Key Features</h2><ul><li>Core frame-based game loop<li>Real-time movement, physics & tile-based collision handlers<li>Manual 2D Rendering<li>Responsive character movement system with precise control<li>Smooth Follow Camera System<li>Data-driven levels with data files<li>Modular AI system for enemies with loot behaviors<li>Cooldown-based skills & potions<li>Visual FX for skills, traps, death, and pickups<li>Status effects system (bleed, damage over time, etc.)<li>Inventory with skill usage, looting & shop support<li>Modular player/enemy skill system with effects<li>XP system with enemy despawn & scaling progression<li>Player can buy and sell potions through NPC shops<li>Traps with view triggers<li>Chest & loot system integrated with inventory<li>Dialogue system with multi-line conversations<li>Mini map with real-time player location tracking<li>In-game settings menu with live audio adjustment<li>Clean architecture with modular scalable codebase</ul></section><section><h2>Challenges & Solutions</h2><h3>Challenge: Creating a responsive and efficient game loop</h3><p>Creating a responsive and efficient frame-based game loop that handles updates in real time without performance drops.<p><strong>Solution:</strong> Designed a game loop in Java to manage movement, physics, animation, and collisions consistently across varying frame rates.<h3>Challenge: Implementing reliable collision detection</h3><p>Implementing reliable collision detection without using third-party engines.<p><strong>Solution:</strong> Built a custom tile-based collision system using bounding box logic for accurate and performant collision resolution.<h3>Challenge: Handling multi-jump and wall slide mechanics</h3><p>Handling multi-jump mechanics (jump and double jump) while managing gravity and fall velocity.<p>Creating a smooth wall slide mechanic that detects wall contact and slows descent.<p><strong>Solution:</strong> Designed a jump state machine to switch between ground, jumping, and double jump phases.<p>Wall detection were added for wall sliding using bounding box checks on specific tiles.<h3>Challenge: Hardcoding levels limited scalability</h3><p>Manually hardcoding levels limited scalability and flexibility for expansion.<p><strong>Solution:</strong> Developed a system that loads level data (tiles, NPCs, traps, etc.) from external files, enabling modular world-building.<h3>Challenge: Designing varied enemy behaviors</h3><p>Designing varied enemy behaviors and drop systems without cluttering code logic.<p><strong>Solution:</strong> Introduced a modular AI system with configurable enemy types, attack styles, and loot tables.<h3>Challenge: Preventing skill/item spamming</h3><p>Preventing players from spamming skills or items, which could break combat balance.<p><strong>Solution:</strong> Added cooldown timers and hotkey-triggered usage to encourage tactical gameplay.<h3>Challenge: Conveying combat feedback visually</h3><p>Conveying combat and interaction feedback visually.<p><strong>Solution:</strong> Implemented sprite-based animations for actions like skill usage, death fades to enhance feedback.<h3>Challenge: Dynamic combat with status effects</h3><p>Making combat more dynamic while balancing new mechanics like damage over time.<p><strong>Solution:</strong> Added effects like bleeding from traps and enemy attacks, layered over health systems with timers.<h3>Challenge: Synchronizing inventory and UI</h3><p>Synchronizing item use, inventory updates, and UI feedback in real time.<p><strong>Solution:</strong> Built a real-time inventory that supports looting, cooldowns, and transactions for seamless gameplay.<h3>Challenge: Scaling skill logic</h3><p>Hardcoding skill logic made it difficult to scale or reuse between players and enemies.<p><strong>Solution:</strong> Created a fully decoupled system allowing both players and enemies to use skills via shared logic for casting, cooldowns, and effects.<h3>Challenge: Managing post-death cleanup and XP</h3><p>Managing post-death cleanup and integrating XP for leveling up without bloating combat logic.<p><strong>Solution:</strong> Implemented an XP and loot system where enemies drop items and experience, and despawn cleanly from the game world.<h3>Challenge: Obtaining potions without killing enemies</h3><p>Player needed a way to obtain more potions without kill enemies.<p><strong>Solution:</strong> Developed a functional NPC potion shop supporting item purchase logic, coin deduction, and inventory feedback.<h3>Challenge: Designing dynamic traps</h3><p>Designing traps that felt dynamic while being easy to place and configure.<p><strong>Solution:</strong> Created configurable trap logic that applies damage or effects, loaded from external files for flexible level design.<h3>Challenge: Context-aware loot</h3><p>Providing meaningful, context-aware loot without manual hardcoding each reward.<p><strong>Solution:</strong> Implemented a scalable chest system that pulls from loot tables based on level and enemy configurations.<h3>Challenge: Interactive NPC conversations</h3><p>Creating interactive NPC conversations with branching dialogue and quest integration.<p><strong>Solution:</strong> Built a simple dialogue text trigger when interact parsed from external files, allowing multi-line interactions.<h3>Challenge: Navigation in complex levels</h3><p>Players often lost direction in complex levels without a full-screen map.<p><strong>Solution:</strong> Added a dynamic mini map that tracks player position and explored areas for easier navigation.<h3>Challenge: Scaling new features</h3><p>Scaling new features became complex due to tight coupling and unclear architecture.<p><strong>Solution:</strong> Followed clean architecture principles, OOP, separating logic, using inheritance, and maintaining modular, maintainable code.</section><section><h2>Project Highlights</h2><p><strong>Built core game engine loop</strong>: Implemented a frame-based game loop in Java with delta time, supporting real-time movement, physics, collision, and animation updates.<p><strong>Custom Physics & Collision</strong>: Developed real-time movement and tile-based collision resolution without external engines, using bounding box detection.<p><strong>Camera Follow System</strong>: Developed a 2D camera that dynamically centers on the player with smooth transitions, keeping gameplay focused and maintaining immersive level framing.<p><strong>Player Movement & Control System</strong>: Implemented responsive player controls including walk, jump, double jump, wall slide, wall jump mechanics. Features smooth physics-based motion, gravity handling, and dynamic animation states.<p><strong>Quest & Level Transition System</strong>: Each level includes its own quest objectives (e.g. reach exit, defeat boss, gather items), tracked and defined externally. Triggers transition to the next level upon completion.<p><strong>Data-Driven Level System</strong>: Loads tilemaps, enemies, items, objects, traps, NPCs, quests, dialogues, and transitions from external files. Enables modular level design and scalable world-building.<p><strong>AI & Loot Behavior System</strong>: Designed modular AI for melee, ranged, and boss enemies with different behaviors, loot drops, and color variation for enemy distinction.<p><strong>Skill & Potion Cooldown System</strong>: Each skill and potion has a cooldown to prevent spamming and add combat depth. Supports hotkey-triggered abilities and item use.<p><strong>Visual FX System</strong>: Created animated effects for skills, trap triggers, death fades, and item pickups using sprite-based animations.<p><strong>Status Effects</strong>: Includes bleed and other effects applied by traps or enemy attacks, dealing damage over time to add tactical variety.<p><strong>Inventory Integration</strong>: Custom inventory system supporting skill usage, looting, cooldowns, and shop transactions with real-time item effect updates.<p><strong>Modular Player & Enemy Skills</strong>: Fully decoupled skill casting system using hotkeys, animations, cooldowns, and effects independently from items and AI logic.<p><strong>Enemy Despawn & XP Progression</strong>: Enemies despawn after death and drop configurable items and XP, supporting scaling experience system for player leveling.<p><strong>Potion Shop Interface</strong>: Players can buy potions using coins with real-time inventory update and error messages for insufficient funds.<p><strong>Trap Mechanics</strong>: Includes hidden and visible traps that trigger damage and status effects. Placed via external config to allow dynamic level design.<p><strong>Dynamic Chest & Loot System</strong>: Chests drop configurable rewards depending on level setup and enemy loot pools. Seamlessly integrated with inventory.<p><strong>Dialogue System</strong>: NPCs can engage in multi-line conversations and trigger quests through dialogue trees defined in external files.<p><strong>Mini Map Navigation</strong>: Displays player position and explored areas to improve level awareness without requiring full-screen map overlays.<p><strong>Settings Menu</strong>: In-game menu for adjusting music and sound effect volume with real-time audio feedback.<p><strong>Scalable Codebase</strong>: Organized using clean architecture principles: inheritance, modular structure, consistent naming, and separation of concerns.</section><section><h2>Project Info</h2><p>Category: Game 2D Application<p>My Role: Game Developer<p>Duration: 3 months<p>Team Size: Solo Project With Some Help<p>Technologies: Java, Java AWT, Java Swing<p>Core Implementations: Game Loop, Custom Physics & Collision, Data-Driven Level System (Tilemap, Enemies, Items, NPCs, Objects, Quests, Traps, Dialogues, Next level Point), Sprite Animation, Trap System (Damage Trigger), Skill Visual Effects, Stat System (Player & Enemy), Procedural Enemy Variants (Random Colors), Cooldown System (Skills & Potions), Status Effect System (e.g., Bleed), Camera Follow System, Background Object System (Touchable & NonTouchable), Enemy AI (Melee, Ranged, Boss), Enemy Skills, Enemy Loot & XP System, Timed Despawn, Chest & Item Drop, Enemy-Specific Loot, Player Movement (Walk, Jump, Double Jump, Wall Slide, Wall Jump), Player Skills, Inventory & Item System, Potion Integration, In-Game Shop (Potions), Equipment System (Stat Buff & Sprite Change), Level-Up System (Stat Scaling), Quest & Leveling System, Dialogue & NPC Interaction, Basic Chat UI, Player UI (Health/Energy/...), Enemy Health UI, Mini Map, Settings Menu<p>Architecture & Design: OOP Modular Design, Separation of Concerns, Data-Driven Architecture, Reusable Component System, Inheritance & Composition, Extensible Combat Logic, Custom Config Loader<p>Quick Stats: Dev Time: 3 months, Type: 2D Platformer Action-RPG, Systems: 40+, Built By: 99% Solo, Graphics: Custom AWT, Engine: None (Pure Java), Architecture: Custom & expandable, Codebase: Large-scale, Audio: Yes</section><section><h2>Related Projects</h2><p><a href="/games/chess2d.html">Chess 2D</a>: Game 2D<p><a href="/games/similar_char.html">Similar Characters Online Game</a>: Online Game</section><section><h2>Project Images</h2><ul><li><img alt="Screenshot game menu"src="/imgs/bleed_game/start-menu.webp"><li><img alt="Screenshot loading screen"src="/imgs/bleed_game/loader.webp"><li><img alt="Screenshot ingame screen"src="/imgs/bleed_game/scene_1.webp"><li><img alt="Screenshot open inventory"src="/imgs/bleed_game/bg_inventory.webp"><li><img alt="Screenshot got hit by enemies"src="/imgs/bleed_game/enemies.webp"><li><img alt="Screenshot open shop"src="/imgs/bleed_game/shop.webp"><li><img alt="Screenshot open game settings"src="/imgs/bleed_game/game-settings.webp"></ul></section></main><footer><h3>Tôn Thất Phu Nhật Minh</h3><nav><a href="/index.html">Home</a> <a href="/index.html#about">About</a> <a href="/index.html#skills">Skills</a> <a href="/projects.html">Projects</a> <a href="/index.html#contacts">Contacts</a></nav><p>Email: <a href="mailto:contact@minhton.dev">contact@minhton.dev</a><p>Phone: <a href="https://zalo.me/0915682176">+84 915682176</a><p>Location: <a href="https://maps.app.goo.gl/DMbT3amH4Zozn8jY9">Ho Chi Minh City, Việt Nam</a><p>Social: <a href="https://www.youtube.com/@IkuraIsCoding">YouTube</a> | <a href="https://www.facebook.com/TTPNMinh/">Facebook</a> | <a href="https://github.com/IkMinhTon">GitHub</a> | <a href="https://www.tiktok.com/@ikuraiscoding">TikTok</a><p>© June 17, 2025 Minh Ton – All Rights Reserved.</footer>
